import React from "react";
import { Loader } from "@googlemaps/js-api-loader";

const Map = () => {
  return (
    <iframe
      width="600"
      height="450"
      // style="border:0"
      // loading="lazy"
      // allowfullscreen
      src="https://www.google.com/maps/embed/v1/place?key=AIzaSyBGDRvmNHsGEYz1A4N8ERL5zWVmPDqyMLs
      &q=Space+Needle,Seattle+WA"
    ></iframe>
  );
};

export default Map;
